import React from 'react'
import Logo from '../img/MEME.gif'

function Profile({ userInfo, setCurrentPage }) {
    return (
        <div>
            <div className="row bg-primary text-white">
                <h1 className="logo py-4 text-center col-lg-9 col-sm-12" style={{ fontSize: 150 }}>MEME· oir</h1>
                <div className="col-lg-3 col-sm-12 text-center">
                    <img className="img py-2 my-2" src={Logo} alt="logo" style={{ height: 200, width: 200 }} />
                </div>
            </div>
            <div className="row text-center py-2">
                <div className="col-lg-12 col-sm-12 bg-success">
                    <img onClick={() => setCurrentPage('profile')} className="prof img-fluid my-2" src={userInfo.profile_img} style={{ height: 100 }} />
                    <p>{userInfo.name}</p>
                    <nav className="navbar bg-success ">
                        <button className="btn btn-outline-primary bg-white mx-auto" onClick={() => setCurrentPage("profile")} type="button">MEME· oir Profile</button>
                        <button className="btn btn-outline-primary bg-white mx-auto" onClick={() => setCurrentPage("templates")} type="button">Create MEME</button>
                    </nav>
                </div>
            </div>
            <h1 className="logo bg-primary text-center text-white mx-0 py-2">{userInfo.name}'s Personal MEME· oir</h1>
            <div className="card-columns text-center">
                {userInfo.meme.map(meme => {
                    return (
                        <div className="card bg-success">
                            <img
                                className="img-fluid"
                                key={meme.id}
                                src={meme.meme_url}
                                alt={meme.id}
                            />
                        </div>
                    )
                })}
            </div>
        </div>
    )
}

export default Profile
